Kyle LeBlanc is an American working overseas in Russia. When he hears his wife being attacked over the phone, Kyle rushes home to find that he's too late. The man who killed his wife is found not guilty on lack of evidence. So Kyle takes the law into his own hands, and kills the man to avenge his wife's death. He is sentenced to life in prison without parole. The Russian prison he is sent to is tough, and the warden amuses himself by putting on fights where he fills his pockets with money by betting on the fights.



